import React from "react";
import image from "../image/consult.jpg"
import image1 from "../image/bed.jpg"
import image2 from "../image/bed1.jpg"


export default function Cards() {
	return (
		<div clasName="homepage" align="center">
		<h1>Our Services</h1>
		<div className="box" style={{ backgroundImage: "url("+ image +")" }}>
		<h2>Consultancy</h2>
		</div>
		<div className="box2" style={{ backgroundImage: "url("+ image2 +")" }}>
		<h2>Consultancy</h2>
		</div>
		<div className="box3" style={{ backgroundImage: "url("+ image +")" }}>
		<h2>Consultancy</h2>
		</div>
		</div>
		);
	}
